        fname:"",
        lname:"",
        email:"",
        password:"",
        Cpassword:"",
        mobile:"",
        dob:""

    })
    return(
        <div>
            <Navbar>
                <Login />
            </Navbar>
            <Jumbotron>
                <Switch>
                <Route exact path="/signup">
                <CreateProfile />
                </Route>
                <Route exact path="/signup/plan">
                    <Plan />
                </Route>
                </Switch>
                <Footer/>
            </Jumbotron>
        </div>
    );
}

export default Signup;
